contracts/utility/minter.sol.content:
//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";

contract minter is AccessControlEnumerable{
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    address public FAH;
    address public CS_Case;

    constructor() {
        _setupRole(MINTER_ROLE, _msgSender());
    }

    function setContracts(address _FAH, address _CS_Case) public {
        require(hasRole(MINTER_ROLE, _msgSender()), "Does not have role");
        FAH = _FAH;
        CS_Case = _CS_Case;
    }

    function mintFAH(uint256 _amount) internal {
        FAH.call{value: 1}(abi.encodeWithSignature("externalMint(uint256)", _amount));
    }
}

